import React from "react";
import PropTypes from "prop-types";

const Event = ({ children }) => {
  return (
    <div className="Event">
      <div className="Event__left">
        <div className="Event__type">
          <span className="Event__type-icon" />
          <p>{children.type}</p>
        </div>
      </div>
      <div className="Event__right">
        <div className="Event__title">
          <p>{children.title}</p>
        </div>
        <div className="Event__time">
          <div className="Event__time--start">{children.start}</div>
          <div className="Event__time--end">{children.end}</div>
        </div>
        <div className="Event__distance">{children.distance}</div>
      </div>
    </div>
  );
};

Event.propTypes = {
  children: PropTypes.array
};

export default Event;
